import React from 'react'

const Employees = () => {
  return (
    <div class="flex justify-center items-center font-sans max-w-2xl bg-slate-200">
        <table>
            <thead className='bg-green-600'></thead>
        </table>
    </div>
  );
}

export default Employees;
